script: |
  super -f text -I q868.spq | sort > q868.out

inputs:
  - name: q868.spq
    data: |
      SELECT col0 + col0 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - ( + + col1 ) - - + 9 BETWEEN + + col1 + + col2 + - + col1 + + col2 * - 37 + + + col1 + col2 AND NULL;
  - name: tab0

outputs:
  - name: q868.out
    data: |
